import React from 'react';
import './header.css';
import {Row,Col,Container} from 'react-bootstrap';
import Button from 'react-bootstrap/Button';

const Header =()=>{
    return(
        <Container className="headerCont ">
            <Row className="headerRow d-flex justify-content-end">
                <Col className="header"><h1>About Me</h1> </Col>
                <Col className="header d-none d-sm"><h2>Skills</h2> </Col>
                <Col className="header"><h4>Projects</h4> </Col>
                <Col className="header"><h4>Contact</h4> </Col>
            </Row>
    </Container>
    );
}
export default Header;
